import React, {useState} from "react";
import style from "../assets/style.module.css";
import { Link } from "react-router-dom";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const Register = () => {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nama: "",
    email: "",
    phone: "",
    password: "",
  });

  const onSubmitHandler = (e) => {
    e.preventDefault();
    console.log(form);
    // if (form.nama === "" || form.email === "" || form.phone === "" || form.password === "") {
    //   alert("Please fill all the field");
    // } else {
    //   const body = {
    //     nama: form.nama,
    //     email: form.email,
    //     phone: form.phone,
    //     password: form.password,
    //   }
    //   axios
    //   .post(`${process.env.REACT_APP_BACKEND_URL}/user/register`, body)
    //   .then((res) => {
    //     console.log(res.data);
    //     alert("Register success");   
    //   })
    //   .catch((err) => {
    //     console.log(err);
    //   });
    // }
  };

  return (
    <div className={style.body}>
      <div className="container-fluid">
        <div className="row">
          <div className={`col-md-6 ${style.bgImage}`}>
            <img src={require("../assets/image/icon.png")} alt="img icon" />
          </div>
          <div className="col-md-6 d-flex align-items-center">
            <form className="row g-3 m-5" onSubmit={(e) => onSubmitHandler(e)}>
              <h3 className="text-center">Let's Get Started</h3>
              <p className="text-center text-muted">
                Create new account to access all features
              </p>
              <div>
                <label htmlFor="inputUsername" className="form-label">
                  Username
                </label>
                <input
                  className="form-control"
                  id="inputUsername"
                  placeholder="Enter name"
                  // onChange={(e) => setForm({...form, nama: e.target.value})}
                />
              </div>
              <div>
                <label htmlFor="inputEmail" className="form-label">
                  Email
                </label>
                <input
                  type="email"
                  className="form-control"
                  id="inputEmail"
                  placeholder="Enter email address"
                  // onChange={(e) => setForm({...form, email: e.target.value})}
                />
              </div>
              <div>
                <label htmlFor="inputPhone" className="form-label">
                  Phone Number
                </label>
                <input
                  className="form-control"
                  id="inputPhone"
                  placeholder="08xxxxxxxxx"
                  // onChange={(e) => setForm({...form, phone: e.target.value})}
                />
              </div>
              <div>
                <label htmlFor="inputPassword" className="form-label">
                  Password
                </label>
                <input
                  type="password"
                  className="form-control"
                  id="inputPassword"
                  placeholder="Create New Password"
                  // onChange={(e) => setForm({...form, password: e.target.value})}
                />
              </div>
              <div>
                <label htmlFor="confirmInputPassword" className="form-label">
                  Confirm Password
                </label>
                <input
                  type="password"
                  className="form-control"
                  id="confirmInputPassword"
                  placeholder="New Password"
                />
              </div>
              <div className="form-check">
                <input
                  id="gridCheck"
                  type="checkbox"
                  className={style.accent}
                />
                <label className="form-check-label" for="gridCheck">
                  I agree of term conditions
                </label>
              </div>
              <div className="d-grid gap-2">
                <button type="submit" className={`btn ${style.btnCustom}`}>
                  <Link className={style.a} to="">Register Accout</Link>
                </button>
              </div>
              <div className="text-center">
                <p className="text-muted">
                  Already have an account?
                  <Link className={style.ap} to="/login">Log in Here</Link>
                </p>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Register;
